type propModal = {
    open: boolean
}


export default function ModalProject(open: propModal){

    return (<>
        {open.open && (
        <div className="w-full h-screen bg-white/5 backdrop-blur-xl absolute flex justify-center items-center z-30">
            <div className="w-modal rounded-xl h-96  bg-white z-20 top-52 left-1" >
                <p className="font-popone font">Ajoute un projet </p>
                    <form action="">
                        <div className="w-1/2">
                                <label htmlFor="name">
                                    Nom
                                    <input type="text" name="nom" className="w-full h-4 rounded-xl" />
                                </label>
                        </div>
                        <div className="w-1/2"></div>
                    </form>

                 </div>
        </div>


        )}
    </>

    )
}
